import { createWebHistory, createRouter } from 'vue-router';
import WelcomePage from '../components/HelloWorld.vue'


const routes = [
  {
    path: '/', component:WelcomePage
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes
});

export { router };
